import logo from './drivcon_logo.png';
import './App.css';
import { FormControl, Button } from 'react-bootstrap';
import React, { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState([]);
  const [selectedRow, setSelectedRow] = useState(null);

  useEffect(() => {
    async function fetchData() {
      const response = await fetch('/data.json');
      const json = await response.json();
      setData(json);
    }
    fetchData();
  }, []);

  const handleRowClick = (row) => {
    setSelectedRow(row);
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>Infusion Monitoring Portal</p>
        <div className='App-control'>
          <FormControl className='App-search' type='text' placeholder='Search' />
          <Button className='Remove-button'>REMOVE</Button>
        </div>
        <div>
          <table className="table-hover">
              <thead>
                <tr className='table-header'>
                  <th className='theader'>Bed No.</th>
                  <th className='theader'>IV Type</th>
                  <th className='theader'>VTBI</th>
                  <th className='theader'>Rate</th>
                  <th className='theader'>Time Remaining</th>
                </tr>
              </thead>
              <tbody>
                {data.map(row => (
                    <tr key={row.bedNo} className={`table-body ${selectedRow === row ? 'selected-row' : ''}`} onClick={() => handleRowClick(row)}>
                      <td>{row.bedNo}</td>
                      <td>{row.ivType}</td>
                      <td>{row.vtbi}</td>
                      <td>{row.rate}</td>
                      <td>{row.timeRemaining}</td>
                    </tr>
                  ))}
              </tbody>
          </table>
        </div>
        <p>Alerts</p>
        <div className='alert-container'>
          <div className='alert-card'></div>
          <div className='alert-card'></div>
          <div className='alert-card'></div>
          <div className='alert-card'></div>
        </div>
      </header>
      <div className='section'>
        {selectedRow && (
          <>
            <div className='other-text'>
              <p>Infusing</p>
              <p className='Fluid-type'>{selectedRow.ivType}</p>
            </div>
            <div className='Flow-rate'>
              <div className='flowrate-text'>
                <p className='flowrate-data'>{selectedRow.rate.split(' ')[0]}</p>
                <p>{selectedRow.rate.split(' ')[1]}</p>
              </div>
              <p>Flow Rate</p>
            </div>
            <div className='data-cards'>
              <div className='card'>

                <p>{selectedRow.vtbi.split(' ')[0]}</p>
              </div>
              <div className='card'></div>
              <div className='card'></div>
            </div>
          </>
        )}
      </div>
    </div>
  );
}

export default App;
